import React from 'react';

const Users = ({ userList }) => {
  return (
    <div className="users">
      
      <ul>
        <li className='in-chat'>Users In Chat:</li>
        {userList.map((user, index) => (
          <li key={index}>{user.username}</li>
        ))}
      </ul>
    </div>
  );
};

export default Users;
